import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className = 'app-wrapper'>

      <nav className='nav'>
        <div><a>Profile</a></div>
        <div><a>Messages</a></div>
        <div><a>News</a></div>
        <div><a>Music</a></div>
        <div><a>Settings</a></div>
      </nav>
      <div className='content'>
      <img src='http://www.talencia.cat/mypics/max/15/157792_vaporwave-steam-backgrounds.jpg'></img>
      </div>
    </div>
  );
}

export default App;
